export type Colors = {
  [user_id: number]: string,
}

const colors: Colors = {
  sandstone: '#ca9874',
  sandstone2: '#e28b4b', // for hovers and such
  white: '#ffffff',
  offWhite: '#f5f5f5',
  greyishBrown: '#505050',
  navy: '#1D3654',
  black: '#242424',
}

export default colors
